import React, { useState } from 'react';
import { Link, Routes, Route, useLocation } from 'react-router-dom';

function ProfileSidebar({ isOpen, toggle }) {
  const location = useLocation();
  const links = [
    { to: 'booking', label: 'Бронь места' },
    { to: 'my-bookings', label: 'Мои брони' },
    { to: 'donations', label: 'Донаты' },
  ];

  return (
    <div
      style={{
        position: 'fixed',
        top: 0,
        left: isOpen ? 0 : '-240px',
        width: 240,
        height: '100%',
        backgroundColor: '#1f2937', // темно-синий-серый
        color: '#f9fafb',
        transition: 'left 0.3s ease',
        boxShadow: '2px 0 8px rgba(0,0,0,0.3)',
        zIndex: 1000,
        paddingTop: 30,
      }}
    >
      <button
        onClick={toggle}
        style={{
          position: 'absolute',
          top: 15,
          right: -40,
          width: 35,
          height: 35,
          borderRadius: '50%',
          border: 'none',
          background: '#3b82f6', // синий
          color: 'white',
          cursor: 'pointer',
          boxShadow: '0 2px 5px rgba(0,0,0,0.3)',
        }}
        aria-label="Toggle Sidebar"
      >
        {isOpen ? '◀' : '▶'}
      </button>
      <nav>
        <ul style={{ listStyle: 'none', padding: 0, margin: 0 }}>
          {links.map(({ to, label }) => (
            <li key={to} style={{ marginBottom: 15 }}>
              <Link
                to={to}
                style={{
                  display: 'block',
                  padding: '12px 20px',
                  borderRadius: 8,
                  backgroundColor:
                    location.pathname.endsWith(to) ? '#2563eb' : 'transparent',
                  color:
                    location.pathname.endsWith(to) ? '#e0e7ff' : '#cbd5e1',
                  fontWeight: location.pathname.endsWith(to) ? '700' : '500',
                  textDecoration: 'none',
                  transition: 'background-color 0.3s',
                }}
              >
                {label}
              </Link>
            </li>
          ))}
        </ul>
      </nav>
    </div>
  );
}

function UserProfile() {
  // Пример данных пользователя - заменить реальными
  const user = {
    email: 'user@example.com',
    role: 'user',
    name: 'Иван Иванов',
    avatarUrl: 'https://i.pravatar.cc/150?img=12',
  };

  return (
    <div
      style={{
        maxWidth: 600,
        margin: 'auto',
        backgroundColor: '#f3f4f6',
        borderRadius: 20,
        padding: 30,
        boxShadow: '0 4px 15px rgba(0,0,0,0.1)',
      }}
    >
      <div style={{ textAlign: 'center', marginBottom: 30 }}>
        <img
          src={user.avatarUrl}
          alt="User avatar"
          style={{
            width: 120,
            height: 120,
            borderRadius: '50%',
            objectFit: 'cover',
            boxShadow: '0 0 12px rgba(59,130,246,0.5)',
          }}
        />
      </div>
      <h2 style={{ textAlign: 'center', marginBottom: 20 }}>{user.name}</h2>
      <div style={{ fontSize: 18, color: '#374151', lineHeight: 1.6 }}>
        <p><b>Email:</b> {user.email}</p>
        <p><b>Role:</b> {user.role === 'admin' ? 'Администратор' : 'Пользователь'}</p>
      </div>
    </div>
  );
}

function Booking() {
  return <div style={{ padding: 20, color: '#374151' }}>Страница бронирования места</div>;
}
function MyBookings() {
  return <div style={{ padding: 20, color: '#374151' }}>Страница просмотра забронированных мест</div>;
}
function Donations() {
  return <div style={{ padding: 20, color: '#374151' }}>Страница донатов</div>;
}

export default function Profile() {
  const [sidebarOpen, setSidebarOpen] = useState(true);

  const toggleSidebar = () => setSidebarOpen((v) => !v);

  return (
    <div style={{ display: 'flex' }}>
      <ProfileSidebar isOpen={sidebarOpen} toggle={toggleSidebar} />
      <main
        style={{
          marginLeft: sidebarOpen ? 240 : 0,
          padding: 30,
          flexGrow: 1,
          minHeight: '100vh',
          background: 'linear-gradient(135deg, #e0e7ff 0%, #fef3c7 100%)',
          transition: 'margin-left 0.3s ease',
        }}
      >
        <Routes>
          <Route path="" element={<UserProfile />} />
          <Route path="booking" element={<Booking />} />
          <Route path="my-bookings" element={<MyBookings />} />
          <Route path="donations" element={<Donations />} />
        </Routes>
      </main>
    </div>
  );
}
